import './form.css'


const ResetPassword = ()=>{


    return(
        
        <form className={'form'}>
            <tex>Informe Seu e-mail</tex>
            <label>
                Email:
                <input type="text" name="email"/>
            </label>
        </form>
        
    )
}

export default ResetPassword;
